import './App.css';
import Grid from './components/Grid.js'
import Navbar from './components/Navbar.js'
import {myGrid, makeMaze} from "./components/calc.js";
import {useState} from 'react';

function App() {
  const [boxes, setBoxes] = useState(myGrid);


  return (
    <div className="App">
      <div className="content">
        <Navbar />
        <Grid boxes={boxes}/>
        <button onClick={() => makeMaze(boxes)}>Make Maze</button>
      </div>
    </div>
  );
}

export default App;
